INSERT INTO `bien` (`id`, `nomBien`, `etat`, `description`, `localite_id`, `type_id`, `bien_id`, `prixLocation`, `proprietaire_id`) VALUES
(2, 'Immeuble Standing', 0, 'L\'immeuble du 28 rue VDN se situe dans le 18e arrondissement de Mermoz, dans le quartier de la Goutte d\'or. Dans ce quartier (71e quartier administratif de Dakar), il occupe dans l\'ilot 23 le lot 88 sur une parcelle de 243 m2.Constitue de 50 etages.', 4, 2, NULL, 505000, 1),
