(4, 'Appartement de luxe', 1, 'Mon appartement se trouve au troisième et dernier étage d’un immeuble à Diamniadio, près de l\'AIDB. J’ai un paillasson devant la porte, avec une vache dessinée dessus pour accueillir les visiteurs.', 3, 3, NULL, 300000, 2),
(5, 'Une grande Chambre', 1, 'Je loue une chambre sans toilette dans un appartement de 3 chambres et salon à la cité assemblée près de la route et non non loin du terminus P7.', 3, 4, NULL, 25000, 1),
(6, 'Une Maison très vaste', 1, 'Je loue une Maison dans un quartier près de la route et non non loin du terminus P7.', 2, 1, NULL, 50000, 1),
(7, 'Appartement à Dakar', 1, 'Depuis l´entrée on accède à un grand salon avec cheminée et une décoration qui combine l´ancien avec des meubles contemporains italiens et des tapis turcs.', 4, 3, NULL, 300000, 1),
(8, 'Immeuble neuf', 1, 'L\'immeuble du 28 rue VDN se situe dans le 18e arrondissement de Mermoz, dans le quartier de la Goutte d\'or. Dans ce quartier (71e quartier administratif de Dakar), il occupe dans l\'ilot 23 le lot 88 sur une parcelle de 243 m2.Constitue de 50 etages.', 2, 2, NULL, 3000000, 2),
(9, 'Immeuble 50 étages', 1, 'L\'immeuble du 28 rue VDN se situe dans le 18e arrondissement de Mermoz, dans le quartier de la Goutte d\'or. Dans ce quartier (71e quartier administratif de Dakar), il occupe dans l\'ilot 23 le lot 88 sur une parcelle de 243 m2.Constitue de 50 etages.', 4, 2, NULL, 700000, 2),
(10, 'Chambre à coucher', 1, 'Je loue une chambre sans toilette dans un appartement de 3 chambres et salon à la cité assemblée près de la route et non non loin du terminus P7.', 2, 4, NULL, 50000, 1);

